import React from "react";
import "./Cart.css";

function Cart(props) {
  const { vector2, vector1, vector6, vector7 } = props;

  return (
    <div className="cart">
      <div className="overlap-group12">
        <img className="vector-2" src={vector2} />
        <img className="vector-12" src={vector1} />
        <img className="vector-6" src={vector6} />
        <img className="vector-7" src={vector7} />
      </div>
    </div>
  );
}

export default Cart;
